                lexer.nextToken();

                if (!setContextFlag) {
                    setContextFlag = true;
                    if (this.context != null) {
                        context = this.context;
                    }
                }

                return object;
            } else {
                throw new JSONException("syntax error, expect '\"' or '}'");
            }

            lexer.next();
            lexer.skipWhitespace();
            ch = lexer.getCurrent();

            Object value;
            if (ch == '"') {
                lexer.scanString();
